    const fieldNames = fields.map(e => <li>{e.fieldName}</li>)
  })

  useEffect(() => {
    const title = new stringMethods(router.pathname)
      .removeSlash()
      .firstCharUpperCase()
      .addStringToEnd(globalVars.titleSubText);
    document.title = title.text;
  }, [router]);

  return (
    <div>
      <Header />
      <h1>Settings</h1>
      <p>This is app settings</p>
      <p>{}</p>
    </div>
  );
};

Settings.getInitialProps = async () => {
  const res = await axios({
    method: "get",
    url: `${globalVars.serverURL}/fields`,
    responseType: "json"
  })
  const data = await res.data;
  return {data};
}

export default Settings;
